INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2030/12/17 14:59:59", 0.0, 1, 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2020/07/31 12:00:00", 2, "アサヒ", 701, 24004, 0.0, 1.99, 24, 10046);
