INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2030/12/17 14:59:59", 0.0, 1, 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2020/07/31 12:00:00", 2, "アサヒ", 703, 24006, 0.0, 3.33, 24, 10046);
