INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2030/12/17 14:59:59", 0.0, 2, 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2020/07/31 12:00:00", 2, "部員３", 803, 24009, 0.0, 0.0, 24, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2030/12/17 14:59:59", 0.0, 1, 192501, "やった！", "2020/07/31 12:00:00", 1, "", 501, 24010, 0.0, 0.0, 24, 10046);
